import React from 'react';
import { Line } from 'react-chartjs-2';

const ResultChart = ({ data }) => {
  const chartData = {
    labels: data.labels,
    datasets: [
      {
        label: '백테스트 결과',
        data: data.values,
        borderColor: 'rgba(75,192,192,1)',
        backgroundColor: 'rgba(75,192,192,0.2)',
      },
    ],
  };

  return (
    <div>
      <h2>백테스트 결과</h2>
      <Line data={chartData} />
    </div>
  );
};

export default ResultChart;
